import ActionTypes from '../actionTypes';

const initialState = {
  todoList: []
}

export default function(state = initialState, action) {
  switch (action.type) {
    case ActionTypes.ADD_TODO:
      return {...state, categoryList: action.payload}
  }
  return state;
}
